import { React, useState } from 'react'
import '../index.css'


export default function Timeline(porps) {
    const [hovering1, setHovering1] = useState(false);

    const handleMouseOver1 = () => {
        setHovering1(true);
    };

    const handleMouseOut1 = () => {
        setHovering1(false);
    };

    const display1 = {
        display: hovering1 === true ? 'inital' : 'none'
    }


    return (
        <div className="timeline-grid" onMouseOver={() => {setHovering1(true)}} onMouseOut={() => {setHovering1(false)}}>

            <div className="timeline-grid-item gridFromTo1">
                {porps.time}
            </div>

            <div className="gridFromTo3">
                <div className="vertical-line">
                </div>
            </div>

            <div className="timeline-grid-item semi-bold gridFromTo2">
                {porps.main}
            </div>

            <div className="timeline-grid-item italics font14 gridFromTo4">
                {porps.minor}
            </div>

            <div style={display1} className="timeline-grid-item gridFromTo5">
                <ul className="marginLess">
                    <li className="font14 colorGrey">{porps.line1}</li>
                    <li className="font14 colorGrey">{porps.line2}</li>
                </ul>
            </div>

        </div>
    )
}
